import React, {Component} from 'react';
import './Contact.css';

class Contact extends Component {

	render() {
		return (
			<div id={'contact'} className={'contact'}>
				<div className={'heading'}>
					<h1 className={'heading-text contact-heading'}>Contact</h1>
				</div>
				<div className={'content'}>
					<h1 className={'contact-heading'}>Have a question or want to work together?</h1>
				</div>
			</div>
		);
	}
}

export default Contact;
